webpackJsonp([0x1c586c71730f1b00],{"./node_modules/json-loader/index.js!./.cache/json/certificates-updating-object-properties.json":function(e,a){e.exports={data:{markdownRemark:{html:'<p>After you’ve created a JavaScript object, you can update its properties at any time just like you would update any other variable. You can use either dot or bracket notation to update.</p>\n<p>For example, let’s look at <code>ourDog</code>:</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>var ourDog = {\n  "name": "Camper",\n  "legs": 4,\n  "tails": 1,\n  "friends": ["everything!"]\n};</code></pre>\n      </div>\n<p>Since he’s a particularly happy dog, let’s change his name to “Happy Camper”. Here’s how we update his object’s name property:</p>\n<p><code>ourDog.name = "Happy Camper";</code> or</p>\n<p><code>ourDog["name"] = "Happy Camper";</code></p>\n<p>Now when we evaluate <code>ourDog.name</code>, instead of getting “Camper”, we’ll get his new name, “Happy Camper”.</p>',fields:{slug:"/certificates/updating-object-properties/"},frontmatter:{title:"Updating Object Properties"}}},pathContext:{slug:"/certificates/updating-object-properties/"}}}});
